ControlPropertyState.AutoRuleBindingString:
IfError(
    RemoveIf(shiftplanner_useravailabilities, shiftplanner_useravailability = ThisItem.shiftplanner_useravailability);
    Refresh(shiftplanner_useravailabilities);,
    Notify("Remove Leave failed", NotificationType.Error, varTheme.toastTimeout),
    Refresh(shiftplanner_shiftbookings)
)

// Refresh with a direct Dataverse call
UpdateContext(
    {
        varStaffModeTable: ForAll(            
            Filter(
                shiftplanner_shiftbookings,
                Date >= varFirstDateOfWeek,
                Date <= DateAdd(varFirstDateOfWeek, 6, TimeUnit.Days),
                Zone.Name =varSelectedZone.Name
            )
            ,
            {
                StaffGroup: Concatenate(
                        Resource.User,
                        'Team Position'.'Shift Team'.Name,
                        'Team Position'.Role.Name
                    ),
                Staff: Resource.'Full Name',
                StaffTeam: 'Team Position'.'Shift Team'.Name,
                StaffRole: 'Team Position'.Role.Name,
                ShiftDate: Date,
                ShiftType: 'Team Position'.'Shift Team'.'Shift Type'.Name
            }
        ),
        varStaffPlanTable : Filter(Users, cmbSelectedUserView.Selected.Value)
    }
);

Set(
    varFirstDateOfWeek,
    DateAdd(
        varFirstDateOfWeek,
        7,
        TimeUnit.Days
    )
);
Select(btnStaffViewRefresh);

/*changes month view to previous month*/
Set(varFirstDateOfWeek, DateAdd(varFirstDateOfWeek, -7, TimeUnit.Days));
Select(btnStaffViewRefresh);

If(IsBlank(varFirstDayOfMonth),

    // If no day is selected, then select today and this month
    Set(
        varDateSelected,
        Today()
    );
    Set(
        varFirstDayOfMonth,
        DateAdd(
            Today(),
            1 - Day(Today()),
            TimeUnit.Days
        )
    );
    Set(
        varFirstDayInView,
        DateAdd(
            varFirstDayOfMonth,
            -(Weekday(varFirstDayOfMonth) - 2 + 1),
            TimeUnit.Days
        )
    );
    Set(
        varLastDayOfMonth,
        DateAdd(
            DateAdd(
                varFirstDayOfMonth,
                1,
                TimeUnit.Months
            ),
            -1,
            TimeUnit.Days
        )
    );
    Set(
        varMinDate,
        DateAdd(
            varFirstDayOfMonth,
            -(Weekday(varFirstDayOfMonth) - 2 + 1),
            TimeUnit.Days
        )
    );
    Set(
        varMaxDate,
        DateAdd(
            DateAdd(
                varFirstDayOfMonth,
                -(Weekday(varFirstDayOfMonth) - 2 + 1),
                TimeUnit.Days
            ),
            40,
            TimeUnit.Days
        )
    );
    Set(
        varPublishButtonDisplayMode,
        DisplayMode.Edit
    );
);

// Reset the screen selector
Set(varCurrentScreen, First(colDropDownNav));
